import React, {useState} from "react"
import CardForm from "../Forms/CardForm"

export default function CreateCard({deckName, deckId}){
    const [card, setCard] = useState({front: "Front", back: "Back"})

    return(
        <div>
            <h3>{deckName}: Add Card</h3>

            <CardForm
                deckId={deckId}
                card={card} />
        </div>
    )
}
